import React from "react";
import { Footer } from "./Footer";
import { Header}  from "./Header";
import { Note } from "./note";
import { Notes } from "./Notes";


function Createcard(Things){
    return <Note
    key={Things.key}
    title={Things.title}
    content={Things.content}
    />
}
function App(){
    return (
        <div>
        <Header/>
        {Notes.map(Createcard)}
        <Footer/>

        </div>
        
        );
}

export {App};
